import React, { Component } from 'react';
import { getMovies } from '../services/fakeMovieService';

class Movies extends Component {
  state = {
    movies: getMovies(),
  };

  movieTable = state.movies.map((movies) => {
    <tr>
      <td>{movies.title}</td>
      <td>{movies.genre.name}</td>
      <td>{movies.stock}</td>
      <td>{movies.dailyRentalRate}</td>
      <td></td>
    </tr>;
  });

  render() {
    return (
      <div>
        <table>
          <div>
            <tr>
              <td>
                <strong>Title</strong>
              </td>
              <td>
                <strong>Genre</strong>
              </td>
              <td>
                <strong>Stock</strong>
              </td>
              <td>
                <strong>Rate</strong>
              </td>
              <td></td>
            </tr>
          </div>

          <div>{this.movieTable}</div>
        </table>
      </div>
    );
  }
}

export default Movies;
